import { IMessageDataWrapper, IMessageParser } from '../../../../../../core';

export class RoomEnterParser implements IMessageParser
{
    public flush(): boolean
    {
        return true;
    }

    public parse(wrapper: IMessageDataWrapper): boolean
    {
        if(!wrapper) return false;

        return true;
    }
}
